import React from "react";
import { Header } from "../components/Layout";

const Cart = () => {
    return (
        <>
            <Header />
            <div className="px-10 py-20">
                <h2 className="text-5xl">Finish Order</h2>
            </div>
        </>
    );
}

export default Cart;
